// src/App.js
import './App.css';
import Imagen from './components/imputImagen';
import Titulo from './components/imputTitulo';
import Parrafo from './components/impurParrafo';
import Enlace from './components/imputEnlace';

function App() {
  return (
    <div className="container mt-4">
      <Titulo texto="Bienvenido a mi proyecto" nivel={1} />
      <Parrafo texto="Este es un párrafo generado desde un componente funcional." />
      <Imagen
        src="https://via.placeholder.com/150"
        alt="Imagen de ejemplo"
        width="150"
        height="150"
      />
      <br />
      <Enlace href="https://reactjs.org" texto="Ir a React" />
    </div>
  );
}

export default App;
